import React from 'react';
import './topGrossing.css';

const TopGrossing = () => {
    return ( 
        <>
            <div className="container">
                <div className="topGrossing-title">
                    <h1>پرفروش ترین ها</h1>
                </div>
                <div className="topGrossing-groups">
                    <ul className='topGrossing-groups-list'>
                        <li className='topGrossing-groups-list-item'>لباس عروسکی</li>
                        <li className='topGrossing-groups-list-active-item'>عروسک</li>
                    </ul>
                </div>
                <div className='topGrossing-products'>
                    <ul className='topGrossing-products-list'>
                        li,topGrossing-products-list
                    </ul>
                </div>
            </div>
        </>
     );
}
 
export default TopGrossing;
